import { Link, useRouteMatch } from "react-router-dom";
import { SidebarLink } from "../../components/AccountUtilities";
import styles from "./AccountPage.module.css";

const UserNavLinks = () => {
  let { url } = useRouteMatch();
  return (
    <>
      <SidebarLink url={`${url}`} iconName="home" linkText="Inicio" />
      <SidebarLink url={`${url}/citas`} iconName="name" linkText="Citas" />
      <SidebarLink url={`${url}/pedidos`} iconName="cart" linkText="Pedidos" />
      <SidebarLink url={`${url}/pedidos`} iconName="user" linkText="Cuenta" />
    </>
  );
};

export default UserNavLinks;
